css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("syncleus.com")

{

/*text&background*/

html, body, tbody, thead, th, tr, td, blockquote, li, ul, h1, h2, h3, h4, h5, h6, font, strong, p, form, footer, fieldset, #footer, #content, #content-wrap, #header, #topnav div, #footer-copyright

{
color: white !important;
background: black !important;
}

select, button, .active a, .slide, #menu ul li a, #menu ul div div li div, .menuHeaderText, .entry, #breadcrumbs div, #seperator, #mw_contentholder div

{
background: black !important;
}

span

{
background-color: black !important;
}

select, input, span, code, textarea, pre, label, div, dd, option

{
color: white !important;
}


/*links*/

a

{
color: #0040ff !important;
}

a:visited

{
color: #224375 !important;
}

/*highlight*/

textarea, pre, input, code

{
background: #333333 !important;
}

/* site specific */
#menu ul div div li img, #menu ul div li img

{
width: 0 !important;
}

}
